// Obtener el output del agente AI (texto plano)
const agentOutput = $input.first().json.output;


// Función para parsear el texto plano con el formato clave: valor
function parseAgentOutput(texto) {
  const lineas = texto.split('\n').filter(linea => linea.trim());
  const datos = {};
  let claveActual = null;
  let valorActual = '';

  for (const linea of lineas) {
    // Verificar si es una línea de clave (contiene : y no empieza con espacio)
    if (linea.includes(':') && !linea.startsWith(' ') && !linea.startsWith('\t')) {
      // Guardar el valor anterior si existe
      if (claveActual && valorActual.trim()) {
        datos[claveActual] = valorActual.trim();
      }

      // Extraer nueva clave y valor
      const colonIndex = linea.indexOf(':');
      claveActual = linea.substring(0, colonIndex).trim().toLowerCase();
      valorActual = linea.substring(colonIndex + 1).trim();
    } else if (claveActual) {
      // Continuar acumulando valor en la misma línea
      valorActual += ' ' + linea.trim();
    }
  }

  // Guardar el último valor
  if (claveActual && valorActual.trim()) {
    datos[claveActual] = valorActual.trim();
  }

  return datos;
}

// Función para procesar arrays desde texto
function procesarArray(texto) {
  if (!texto) return [];

  // Si el texto contiene puntos de lista (•, -, *) o números
  if (texto.includes('•') || texto.includes('**')) {
    return texto.split(/[•\-\*]/).map(item => item.trim()).filter(item => item.length > 0);
  }

  // Si es una lista separada por líneas que empiezan con **
  const lineas = texto.split('\n').filter(linea => linea.trim());
  if (lineas.some(linea => linea.includes('**'))) {
    return lineas.filter(linea => linea.trim().length > 0);
  }

  return [texto];
}

// Función para extraer el JSON al final del output si existe
function extraerJSON(texto) {
  try {
    // Buscar el patrón de JSON al final del texto
    const jsonMatch = texto.match(/\{[\s\S]*\}$/);
    if (jsonMatch) {
      return JSON.parse(jsonMatch[0]);
    }
  } catch (error) {
    // Si no se puede parsear el JSON, continuar con el parseo de texto
  }
  return null;
}

// Parsear los datos del output
const datosParseados = parseAgentOutput(agentOutput);
const jsonExtraido = extraerJSON(agentOutput);

// Usar datos del JSON si están disponibles, sino usar los parseados del texto
const datos = jsonExtraido || datosParseados;

// Función para formatear arrays para la plantilla
function formatearTrayectoria(trayectoriaData) {
  if (Array.isArray(trayectoriaData)) {
    return trayectoriaData.join('\n-   ');
  }

  if (typeof trayectoriaData === 'string') {
    const items = procesarArray(trayectoriaData);
    return items.join('\n-   ');
  }

  return trayectoriaData || '';
}

function formatearCapacidades(capacidadesData) {
  if (Array.isArray(capacidadesData)) {
    return capacidadesData.join('\n-   ');
  }

  if (typeof capacidadesData === 'string') {
    const items = procesarArray(capacidadesData);
    return items.join('\n-   ');
  }

  return capacidadesData || '';
}

// Función para extraer interpretación del pulso
function extraerInterpretacionPulso(fraseCompleta) {
  if (!fraseCompleta) return '';

  // Buscar después de la frase hasta el final o hasta encontrar otro patrón
  const partes = fraseCompleta.split(/[•\-]/);
  if (partes.length > 1) {
    // Tomar todas las partes después de la primera línea
    return partes.slice(1).map(p => p.trim()).join(' ');
  }

  return fraseCompleta;
}

// Preparar las variables para la plantilla
const variablesPlantilla = {
  // Información básica
  nombre: datos.nombre || '',
  titulo: datos.titulo || '',

  // Contenido principal
  perfil_antifragil: datos.perfil_antifragil || '',
  trayectoria: formatearTrayectoria(datos.trayectoria),
  capacidades_antifragiles: formatearCapacidades(datos.capacidades_antifragiles),

  // Índice de Antifragilidad
  resumen_antifra: datos.resumen_antifra || '',
  puntaje_general: datos.puntaje_general || 0,
  nivel_general: datos.nivel_general || '',
  evolucion_activa_puntaje: datos.evolucion_activa_puntaje || 0,
  adaptacion_proactiva_puntaje: datos.adaptacion_proactiva_puntaj || datos.adaptacion_proactiva_puntaje || 0,
  agilidad_emocional_puntaje: datos.agilidad_emocional_puntaje || 0,
  destructividad_consciente_puntaje: datos.destructividad_consciente_puntaje || 0,

  // Presencia Ejecutiva
  puntaje_total: datos.puntaje_total || 0,
  nivel_presencia_ejecutiva: datos.nivel_presencia_ejecutiva || '',
  observaciones_complementarias: datos.observaciones_complementarias || '',

  // Pulso Antifrágil
  patron: datos.patron || '',
  frase: datos.frase || '',
  interpretacion: extraerInterpretacionPulso( datos.interpretacion),
  //interpretacion: extraerInterpretacionPulso(datos.frase) || datos.interpretacion || '',

  // Metadatos
  fecha_procesamiento: new Date().toISOString(),
  raw_output: agentOutput
};

// Crear objeto de salida sin conflictos
